import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";
import * as yup from "yup";
import { useForm } from "react-hook-form";

import { yupResolver } from "@hookform/resolvers/yup";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { postHttpRequest } from "../../../../axios";



const schema = yup.object().shape({
	email: yup.string().email("Invalid email").required("Email is required"),
	password: yup
		.string()
		.required("Password is required")
		.min(8, "Password should be greater then 8 digits")
		.max(32, "Password should be smaller then 32 digits"),
	repeatPassword: yup
		.string()
		.required("Confirm password is required")
		.min(8, "Password should be greater then 8 digits")
		.max(32, "Password should be smaller then 32 digits")
		.oneOf([yup.ref("password"), null], "Passwords must match"),
});

const SignUp = ({setTabIndex }) => {
	const navigate = useNavigate();
	const dispatch = useDispatch();
	const [passView, setPassView] = useState({
		newPass: false,
		confirmPass: false,
	});
	const {
		register,
		handleSubmit,
		formState: { errors },
	} = useForm({ resolver: yupResolver(schema) });

	const onSubmitHandler = async payload => {

		postHttpRequest("http://localhost:5000//v1/auth/register", payload)
			.then(function (res) {
			console.log(res, "resres")
				toast.success(res.data.message);
			})
			.catch(function (error) {

				toast.error(error.response.data.message);
			});
	};



	return (
		<div className="px-4">
			<div className="rounded-lg text-center signup_tab_data">
				<div>
					<h5 className="font-bold signin-heading pt-6 f-size-18 mb-4">signUpUsing</h5>



					<h5 className="font-bold signin-heading pt-10 f-size-18 mb-6">
					signUpWithEmail
					</h5>
					<form
						onSubmit={handleSubmit(onSubmitHandler)}
						className="mb-3"
					>
						<div className="login_form sm:px-4">
							<div className="form-field mb-5 sm:mb-7 ml-auto mr-auto">
								<label className="f-size-13 font-normal formLabelClr">
								email
								</label>
								<input
									id="email"
									name="email"
									type="text"
									className="login-email rounded-lg border border-slate-100 border-solid w-full"
									// placeholder={"email"}
									{...register("email")}
								></input>
								<p className="errors">
									{errors.email?.message}
								</p>
							</div>
							<div className="form-field mb-5 sm:mb-7 ml-auto mr-auto">
								<label className="f-size-13 font-normal formLabelClr">
								password
								</label>
								<input
									{...register("password")}
									type={
										passView.newPass ? "text" : "password"
									}
									className="login-email rounded-lg border border-slate-100 border-solid w-full"
									// placeholder={t("static.password")}
								></input>
								<span
									onClick={() =>
										setPassView({
											...passView,
											newPass: !passView.newPass,
										})
									}
								>
									{/* {passView.newPass ? (
										<EyeslashIcon />
									) : (
										<EyeIcon />
									)}{" "} */}
								</span>
								<p className="errors">
									{errors.password?.message}
								</p>
							</div>
							<div className="form-field mb-3 sm:mb-4 ml-auto mr-auto">
								<label className="f-size-13 font-normal formLabelClr">
								repeatPassword
								</label>
								<input
									{...register("repeatPassword")}
									type={
										passView.confirmPass
											? "text"
											: "password"
									}
									className="login-email rounded-lg border border-slate-100 border-solid w-full"
									// placeholder={t("static.repeatPassword")}
								></input>
								<span
									onClick={() =>
										setPassView({
											...passView,
											confirmPass: !passView.confirmPass,
										})
									}
								>

								</span>
								<p className="errors">
									{errors.repeatPassword?.message}
								</p>
							</div>
						</div>
						<button
							type="submit"
							className="sign-in justify-center flex items-center  w-full max-width rounded-lg border py-4 f-size-16 font-bold mb-2.5"
						>
						signUp
						</button>
					</form>
					<div className="mb-1.5 sm:mb-2.5">
						<span>haveAnAccount </span>
						<button className="forget-pass" onClick={() =>setTabIndex(0)} >signIn </button>
					</div>
					<div>
						<span className="block sm:inline-block">byCreatingAn</span>
						<Link className="forget-pass" to="#">

                        termsOfUse
						</Link>
					</div>
				</div>
			</div>
		</div>
	);
};

export default SignUp;
